import React from "react";
import {Jumbotron,Container,b} from "reactstrap";
const Home=() =>{
    return (
        <div>
            <Jumbotron>
                <h1>Suraj Kumar</h1>
                <p>This is developed by Suraj for learning purpose backedn is on spring boot and frontent on react js</p>
            </Jumbotron>
        </div>
    )
}

export default Home;
